models.Post(models_Post_1):
 "title": "About the model layer"
 "date": "2009-06-13T19:00:00"
 "content": "The model has a central position in a Play! application. It is the domain-specific\
  \  representation of the information on which the application operates.\nMartin\
  \ fowler defines it as:\n    \nResponsible for representing concepts of the business,\
  \ information about the  business situation, and business rules. State that reflects\
  \ the business situation  is controlled and used here, even though the technical\
  \ details of storing it are  delegated to the infrastructure. This layer is the\
  \ heart of business software.\n"
 "author": "models_User_2"
 "createdAt": "2012-03-21T10:32:21"
 "updatedAt": "2012-03-21T10:32:21"

