models.Post(models_Post_3):
 "title": "The MVC application"
 "date": "2009-06-05T19:00:00"
 "content": "A Play! application follows the MVC architectural pattern as applied to\
  \ the  architecture of the Web.\nThis pattern splits the application into separate\
  \ layers: the Presentation  layer and the Model layer. The Presentation layer is\
  \ further split into a  View and a Controller layer.\n"
 "author": "models_User_4"
 "createdAt": "2012-03-21T10:32:21"
